import React from 'react';
import {View, TouchableOpacity, Text, StyleSheet} from 'react-native';

const Botao = ({text}) => {
    return(
        <View>
            <TouchableOpacity style={StyleSheet.button}>
                <Text>{text}</Text>
            </TouchableOpacity>
        </View>
    )
}

export default Botao

const styles = StyleSheet.create({
    button:{
        alinItems: 'center',
        backgroundColor: '#939',
        paddingHorizontal: 40,
        paddingVertical: 30,
        width: 125,
        borderRadius:20,
    }
})
